void set_bar_graph_count( uint8_t value ){

	set_bar_graph(0); //clear all bars

	for ( uint8_t i = 0; i < value; i++ ){
		set_bar(i);
	}
}

void bargraph_zip_right(){
	for (unsigned int bar = 0; bar<=9; bar++){
		set_bar_graph(0);
		set_bar(bar);
		wait(15);
	}
	set_bar_graph(0);
}

void setup()
{
	wait( 200 ); // Wait for neighbors to start up
}

void loop()
{
	block_value = weighted_average();

	unsigned int hundreds = block_value/100;
	unsigned int tens = (block_value / 10) % 10;
	unsigned int ones = block_value % 10;


	for (unsigned int i=0; i<4; i++){ 

		// zip the display between digits to help distinguish them
		if ( i !=3 ){
			bargraph_zip_right();
		}

		switch (i){
			case 0:
				set_bar_graph_count(hundreds);
			break;
			case 1:
				set_bar_graph_count(tens);
			break;
			case 2:
				set_bar_graph_count(ones);
			break;
			case 3:
				set_bar_graph(0); // Pause between values
			break;
		}

		wait(750);
	}
}

